import React, { useEffect } from "react";
import {
  Row,
  Col,
  Button,
  Badge,
  Card,
  CardHeader,
  CardImg,
  CardTitle,
  CardBody,
  Container
} from "reactstrap";
import "react-confirm-alert/src/react-confirm-alert.css";

// core components
import LandingEstNavbar from "components/Navbars/LandingEstNavbar.js";
import Footer from "components/Footer/Footer.js";

const PaginaLoja = (props) => {
  useEffect(() => {
    document.body.classList.toggle("landing-page");
    // Specify how to clean up after this effect:
    return function cleanup() {
      document.body.classList.toggle("landing-page");
    };
  }, []);

  return (
    <>
      <LandingEstNavbar />
      <div className="wrapper">
        <div className="page-header">
          <img
            alt="..."
            className="path"
            src={require("assets/img/blob.png").default}
          />
          <img
            alt="..."
            className="path2"
            src={require("assets/img/path2.png").default}
          />
          <img
            alt="..."
            className="shapes triangle"
            src={require("assets/img/triunghiuri.png").default}
          />
          <img
            alt="..."
            className="shapes wave"
            src={require("assets/img/waves.png").default}
          />
          <img
            alt="..."
            className="shapes squares"
            src={require("assets/img/patrat.png").default}
          />
          <img
            alt="..."
            className="shapes circle"
            src={require("assets/img/cercuri.png").default}
          />
          <Container>
            <Row>
              <Col>
                <h1 className="text-white" style={{ marginTop: "150px" }}>
                  Página da Loja
                </h1>
              </Col>
              <Col lg="4">
                <Button color="default" style={{ marginTop: "150px" }}>
                  Suas moedas <Badge color="success">$430</Badge>
                </Button>
              </Col>
            </Row>
          </Container>
        </div>
      </div>
      <Footer />
    </>
  );
};
export default PaginaLoja;
